webpackJsonp([58926615894339],{1198:function(t,e){t.exports={data:{site:{siteMetadata:{docSections:{basics:["/basics/introduction/"],guides:["/guides/quick-start-guide/","/guides/create-component-guide/"],configurations:["/configurations/details/","/configurations/custom-webpack-config/","/configurations/preset-webpack/"],components:["/components/overview/","/components/globals/","/components/wingsuit/","/components/twig/","/components/presentation/"],assets:["/assets/overview/","/assets/images/","/assets/svg/","/assets/javascript/"],drupal:["/drupal/ui_patterns/"],testing:["/testing/manual-testing/"]}}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/404/"},frontmatter:{title:"",id:null}}},{node:{fields:{slug:"/assets/images/"},frontmatter:{title:"Images & Icons",id:"images"}}},{node:{fields:{slug:"/assets/javascript/"},frontmatter:{title:"Javascript",id:"javascript"}}},{node:{fields:{slug:"/assets/overview/"},frontmatter:{title:"Overview",id:"overview"}}},{node:{fields:{slug:"/basics/introduction/"},frontmatter:{title:"Introduction",id:"introduction"}}},{node:{fields:{slug:"/components/wingsuit/"},frontmatter:{title:"Wingsuit (UI Patterns)",id:"wingsuit"}}},{node:{fields:{slug:"/components/presentation/"},frontmatter:{title:"Presentation",id:"presentation"}}},{node:{fields:{slug:"/components/twig/"},frontmatter:{title:"Twig only",id:"twig"}}},{node:{fields:{slug:"/guides/create-component-guide/"},frontmatter:{title:"Create new component",id:"create-component-guide"}}},{node:{fields:{slug:"/assets/svg/"},frontmatter:{title:"SVGs",id:"svg"}}},{node:{fields:{slug:"/guides/quick-start-guide/"},frontmatter:{title:"Quickstart guide",id:"quick-start-guide"}}},{node:{fields:{slug:"/components/overview/"},frontmatter:{title:"Overview",id:"overview"}}},{node:{fields:{slug:"/configurations/custom-webpack-config/"},frontmatter:{title:"Custom webpack configuration",id:"custom-webpack-config"}}},{node:{fields:{slug:"/drupal/overview/"},frontmatter:{title:"Component-Based Theming in Drupal",id:"overview"}}},{node:{fields:{slug:"/configurations/preset-webpack/"},frontmatter:{title:"Presets",id:"preset-webpack"}}},{node:{fields:{slug:"/configurations/details/"},frontmatter:{title:"Configuration",id:"details"}}},{node:{fields:{slug:"/drupal/ui_patterns/"},frontmatter:{title:"How to use Wingsuit with UI Patterns and Layout Builder",id:"ui_patterns"}}},{node:{fields:{slug:"/components/globals/"},frontmatter:{title:"Global variables.",id:"globals"}}},{node:{fields:{slug:"/testing/manual-testing/"},frontmatter:{title:"Manual Testing",id:"manual-testing"}}}]},markdownRemark:{html:'<p>This “How To” explains how to use Wingsuit with UI Patterns and Drupal Layout Builder. </p>\n<h2 id="step-1"><a href="#step-1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Step 1:</h2>\n<p>Add following modules to your composer.json:</p>\n<ul>\n<li><a href="https://www.drupal.org/project/components">components</a></li>\n<li><a href="https://www.drupal.org/project/ui_patterns">ui_patterns</a></li>\n<li><a href="https://www.drupal.org/project/ui_patterns_layout_builder">ui_patterns_layout_builder</a></li>\n<li><a href="https://www.drupal.org/project/ui_patterns_layout_settings">ui_patterns_settings</a></li>\n<li><a href="https://www.drupal.org/project/wingsuit_companion">wingsuit_companion</a></li>\n</ul>\n<p>After that enable following modules:</p>\n<ul>\n<li>wingsuit_companion</li>\n<li>ui_patterns_layout_builder</li>\n<li>ui_patterns_settings</li>\n</ul>\n<pre><code>drush en ui_patterns_layout_builder ui_patterns_settings wingsuit_companion \n</code></pre>\n<h2 id="step-2"><a href="#step-2" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Step 2:</h2>\n<p>Install Wingsuit under <code>themes/custom</code> and enable the wingsuit theme and set it as default.</p>\n<pre><code>npx @wingsuit-designsystem/cli init\n</code></pre>\n<p>Go to the wingsuit folder and run:</p>\n<pre><code>yarn build:drupal\n</code></pre>\n<p>The command generates the dist folder to <code>wingsuit/dist/app-drupal</code>. The theme takes css js and patterns from the dist folder and not from <code>source</code> folder.</p>\n<p>You can configure the path of your dist folder. See <a href="/index-97d19ad41731d28133af9326930e7782.md">Configuration details</a> to configure the webpack part. Open “Wingsuit settings” under Configuration in drupal and adjust the path to the dist folder.</p>\n<p>If you want to develop in drupal run:</p>\n<pre><code>yarn dev:drupal\n</code></pre>\n<p>This will run start and <code>webpack watch</code>.</p>\n<h2 id="congratulations"><a href="#congratulations" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Congratulations:</h2>\n<p>Now your are done now! Open <code>Manage Display</code> you will find all your patterns.</p>',fields:{slug:"/drupal/ui_patterns/"},frontmatter:{title:"How to use Wingsuit with UI Patterns and Layout Builder",id:"ui_patterns"}}},pathContext:{slug:"/drupal/ui_patterns/"}}}});
